# shortestPathBinaryMatrix.py : https://github.com/cheoljoo/problemSolving/tree/master/leetcode

class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        self.count = 0
        self.ans = 1
        self.di = [1,0,-1]
        g = [[1 for _ in range(len(grid)+2)] for _ in range(len(grid)+2)]
        visit = [[math.inf for _ in range(len(grid)+2)] for _ in range(len(grid)+2)]
        for r in range(len(grid)):
            for c in range(len(grid)):
                g[r+1][c+1] = grid[r][c]
        if g[1][1] != 0 :
            return -1
        if g[len(grid)][len(grid)] != 0 :
            return -1
        return self.bfs((1,1),(len(grid),len(grid)),1,g,visit)  # start,target , path Count

    def bfs(self,s,t,pc,g,visit):
        # self.count += 1
        sr,sc = s
        tr,tc = t
        res = 1
        q = [(1,sr,sc)]
        visit[sr][sc] = 1
        count = 0
        while q : 
            pc,sr,sc = q.pop(0)
            # self.printTable(g,visit)
            count += 1
            if sr == tr and sc == tc:
                print("count:",count," ")
                return pc
            for r in self.di:
                for c in self.di:
                    if r != 0 or c != 0:
                        if g[sr+r][sc+c] == 0 and visit[sr+r][sc+c] == math.inf:
                            visit[sr+r][sc+c] = 1
                            q.append((pc+1,sr+r,sc+c))
        return -1

    def printTable(self,g,visit):
        # if self.count >= 200 :
        #     return
        print("[",self.count,"]")
        for r in range(len(g)):
            for c in range(len(g[0])):
                if g[r][c] == math.inf:
                    print("F",sep="",end="")
                else:
                    print(g[r][c],"",sep="",end="")
            print("    ",end="")
            for c in range(len(g[0])):
                if visit[r][c] == math.inf:
                    print("_",sep="",end="")
                else:
                    print(visit[r][c],"",sep="",end="")
            print()
                

           
def run(s,expect):
    print(len(s),end="")
    start = time.time()
    A = Solution()
    r = A.shortestPathBinaryMatrix(s)
    print(" total_time1 : ", time.time() - start , "-> ", end="") 
    
    if r == expect:
        print("SUCCESS -> ",end="")
    else :
        print("ERROR(",expect,") -> ",sep="",end="")
    print(r, s , end="")  
    print()

